INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40000, 0, 91002, "", 0, 8, "", 1, 36, 100, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 1, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 107501, 8, "ぺコリーヌ", 1, 37, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 1, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 107601, 8, "コッコロ", 2, 38, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 1, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 107801, 8, "キャル", 3, 39, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 1, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 107701, 8, "スズメ", 4, 40, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 1, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 107901, 8, "タマキ", 5, 41, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 2, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 107501, 8, "ぺコリーヌ", 6, 42, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 2, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 107601, 8, "コッコロ", 7, 43, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 2, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 107801, 8, "キャル", 8, 44, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 2, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 107701, 8, "スズメ", 9, 45, 150, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40001, 2, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 107901, 8, "タマキ", 10, 46, 150, 0);
