INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 1, 24001, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 2, "リリ", 1, 321, 1, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 1, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 2, "クリア", 2, 322, 1, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 1, 24001, "んーと。\nこれ、あげる。\nはい", 126101, 2, "プレシア", 3, 323, 1, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 2, 24001, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 2, "リリ", 4, 324, 1, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 2, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 2, "クリア", 5, 325, 1, 0);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 2, 24001, "お兄。\nきてくれて、うれしい", 126101, 2, "プレシア", 6, 326, 1, 0);
